* Use SDL's built-in timer functions (e.g., `SDL_GetTicks()`) to measure time intervals for smoother animation.
* Optimize your game loop to reduce CPU usage by limiting the number of SDL events polled and using a fixed-time step for updating and rendering.
* Consider using a separate thread for animation (if you're familiar with multithreading) to avoid blocking the main thread.

