const modal = document.getElementById('chat-modal');
const chatForm = document.getElementById('chat-form');
const chatHistory = document.querySelector('.chat-history');
const userInput = document.getElementById('user-input');

// Initialize chat history
const chatData = [
  {
    type: 'human',
    message: 'Hello, how are you?',
    timestamp: '12:45 PM',
  },
  {
    type: 'bot',
    message: 'I\'m doing well, thanks! What\'s on your mind?',
    timestamp: '12:47 PM',
  },
  {
    type: 'human',
    message: 'I\'m looking for information on AI development.',
    timestamp: '1:02 PM',
  },
  {
    type: 'bot',
    message: 'AI development is a rapidly growing field. I\'d be happy to help you with resources and tips.',
    timestamp: '1:05 PM',
  },
];

chatData.forEach((message) => {
  const msgElement = document.createElement('div');
  msgElement.classList.add('message');
  if (message.type === 'human') {
    msgElement.innerHTML = `<span class="human-msg">${message.message}</span><span class="timestamp">${message.timestamp}</span>`;
  } else {
    msgElement.innerHTML = `<span class="bot-msg">${message.message}</span><span class="timestamp">${message.timestamp}</span>`;
  }
  chatHistory.appendChild(msgElement);
});

// Show modal and focus on input field
document.getElementById('chat-btn').addEventListener('click', () => {
  modal.style.display = 'block';
  userInput.focus();
});

// Send message functionality (simple implementation)
chatForm.addEventListener('submit', (e) => {
  e.preventDefault();
  const userMessage = userInput.value;
  userInput.value = ''; // clear input field

  // Simulate bot response (you can replace with your AI logic)
  const botResponse = 'Great question! Here\'s some information on AI development...';
  const botMessage = {
    type: 'bot',
    message: botResponse,
    timestamp: new Date().toLocaleTimeString(),
  };
  chatData.push(botMessage);

  const botMsgElement = document.createElement('div');
  botMsgElement.classList.add('message');
  botMsgElement.innerHTML = `<span class="bot-msg">${botResponse}</span><span class="timestamp">${botMessage.timestamp}</span>`;
  chatHistory.appendChild(botMsgElement);
});
```
