1. The modal is initially hidden, and when you click the "Chat with Bot" button, it appears.
2. The chat history is populated with the initial 4 messages.
3. When you type a message and submit, the bot responds with a simulated message, which is appended to the chat history.
4. The chat history scrolls automatically to the newest message.

Note that this is a basic implementation, and you can enhance the chatbot's functionality, add more features, and improve the design as needed.

A classic problem in TypeScript: **discriminating between multiple possible types with a guarantee**. This is known as a "variant type" or "sum type" scenario. Here are a few ways to convey your intent to the TypeScript type system:

**1. **Union type with a narrowed assertion** (`asserts` or a custom function)
```ts
type MyType = { type: 'A' } | { type: 'B' } | { type: 'C' };

let value: MyType;

// In practice, it's always going to be 'specificTypeA'
function getActualType(value: MyType) {
  if (/* some condition */) {
    return value as { type: 'specificTypeA' }; // asserts the narrowed type
  }
  throw new Error('Invalid value');
  // or return a default value, if needed
}

let narrowedValue: { type: 'specificTypeA' } = getActualType(value);
```
By using the `as` keyword with an assertion, you're telling TypeScript, "I know what I'm doing, and I'm sure this value will only be of type `{ type: 'specificTypeA'}`." Keep in mind that while this helps with code readability and maintainability, it's still a runtime assertion.

**2. **Using a discriminating property and a type guard** (recommended)
```ts
type MyType = { type: 'A', aProperty: string } | { type: 'B', bProperty: number };

function isSpecificTypeA(value: MyType): value is { type: 'A', aProperty: string } {
  return value.type === 'A';
}

let value: MyType;

if (isSpecificTypeA(value)) {
  const narrowedValue: { type: 'A', aProperty: string } = value;
  // Now you can safely access aProperty
}
```
Here, we create a type guard function `isSpecificTypeA` that checks the `type` property. If it returns `true`, the compiler infers that the value is indeed of type `{ type: 'A', aProperty: string }`. This approach is more explicit and safer, as the type system can still catch errors if the condition is false.

**3. **Using a mapped type with a conditional type** (a more advanced approach)
```ts
type MyType = { type: 'A', [K in 'A' | 'B' | 'C']?: MyTypeProps<K> };
type MyTypeProps<T extends 'A'> = { aProperty: string };
type MyTypeProps<T extends 'B'> = { bProperty: number };
type MyTypeProps<T> = never; // or some default type, if needed

let value: MyType;

type SpecificTypeA = MyType extends { type: 'A' } ? MyType : never;

let narrowedValue: SpecificTypeA = value; // OK, if value.type === 'A'
```
This approach uses mapped types and conditional types to create a "singleton type" for each specific variant. While more complex, it provides a strong type guarantee.

Choose the approach that best fits your use case, considering the trade-offs between readability, maintainability, and type safety.

