```cpp
#include <iostream>
#include <fstream>
#include <sstream>
#include <string>
#include <map>

using namespace std;

// Function to count the word occurrences
int countWordOccurrences(const string& fileName, const string& targetWord) {
    int count = 0;
    string line, word;

    ifstream file(fileName);
    if (!file) {
        cerr << "Error opening file." << endl;
        return -1; // Return error code if file not found
    }

    while (getline(file, line)) {
        stringstream lineStream(line);
        string word;
        while (getline(lineStream, word, ' ')) { // Split by spaces
            if (word == targetWord) {
                count++; // Increment the count if the word matches
            }
        }
    }
    file.close();
    return count;
}

int main() {
    string fileName = "input.txt"; // Replace with your file name
    string targetWord = "example"; // Replace with the word to search

    int occurrences = countWordOccurrences(fileName, targetWord);
    if (occurrences == -1) {
        cout << "File not found or error occurred." << endl;
    } else {
        cout << "The word '" << targetWord << "' occurs " << occurrences << " times in " << fileName << "." << endl;
    }

    return 0;
}
```

**How it works:**

1. The `countWordOccurrences` function takes two parameters: the file name and the target word.
2. It opens the file and checks if it exists. If not, it returns an error code (-1).
3. It reads the file line by line using `getline`.
4. For each line, it uses a `stringstream` to split the line into individual words (separated by spaces).
5. It compares each word with the target word and increments a counter if a match is found.
6. Finally, it returns the count of occurrences.
7. In the `main` function, we call `countWordOccurrences` and print the result.

**Note:** This program is case-sensitive. If you want a case-insensitive search, you can modify the comparison inside the `while` loop to use `std::tolower` or `std::toupper` from the `<cctype>` header. For example: `if (std::tolower(word[0]) == std::tolower(targetWord[0]) && word == targetWord)` (though this is not the most efficient approach). A more efficient solution would be to use a `std::string` comparison with a case-folded version of both the word and the target word.
